import { Typography, Button, Stack, MenuItem } from "@mui/material";
import { Box } from "@mui/system";

export const HelloBlock = () => {
  return (
    <Stack spacing={2}>
      <MenuItem>
        <Box>
          <Typography variant="h5">
            Hello, It's babai NFT marketplace
          </Typography>
        </Box>
      </MenuItem>

        <Box
          sx={{
            display: "flex",
            flexDirection: "column",
          }}
        >
          <Typography variant="h5">
            {" "}
            Hello, It's my marketplace_project
          </Typography>
          <Typography
            sx={{
              mt: "1rem",
            }}
            variant="caption"
          >
            random text random" text random text random text
          </Typography>
          <Box
            sx={{
              mt: "1rem",
              display: "flex",
              alignContent: "space-between",
            }}
          >
            <Button sx={{ mr: "1.5rem" }} variant="contained">
              Upload
            </Button>
            <Button variant="contained">Explore</Button>
          </Box>
        </Box>
    </Stack>
  );
};
